### Step 1: Set Up Your React Environment

If you haven't already set up a React project, you can create one using Create React App by running:

```bash
npx create-react-app my-app
cd my-app
npm start
```

### Step 2: Create the Component

Create a new file called `ItemList.js` in the `src` folder of your React project. Add the following code to define a component that renders a list of items:

```jsx
import React from 'react';

const ItemList = () => {
  // Define an array of items
  const items = [
    { id: 1, name: 'Apple', price: 0.99 },
    { id: 2, name: 'Banana', price: 0.59 },
    { id: 3, name: 'Cherry', price: 2.99 }
  ];

  return (
    <div>
      <h1>Item List</h1>
      <ul>
        {items.map(item => (
          <li key={item.id}>
            {item.name} - ${item.price.toFixed(2)}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ItemList;
```

### Step 3: Use the Component in Your App

Open the `src/App.js` file and modify it to use the `ItemList` component:

```jsx
import React from 'react';
import './App.css';
import ItemList from './ItemList';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ItemList />
      </header>
    </div>
  );
}

export default App;
```

### Step 4: Run Your Application

Make sure your development server is running (you can start it with `npm start` if it's not already running). Your browser should open to `http://localhost:3000` and display the list of items.

