    const newItemInput = document.getElementById('newItemInput');

    function addItem() {
      const newItemText = newItemInput.value.trim();
      if (newItemText !== '') {
        const newItem = document.createElement('li');
        newItem.textContent = newItemText;
        itemList.appendChild(newItem);
        newItemInput.value = '';
      }
    }
  </script>
</body>
</html>
```

